UBICACIÓN: Bajo Lunlunta ? Maipú ? Mendoza- Argentina. La propiedad se encuentra a 17 minutos de la ciudad, con excelente acceso mediante Ruta 40 (autopista) hasta Luján de Cuyo y luego por calle Azcuénaga hasta lunlunta. Situada a orillas del río Mendoza.
Superficie: 2,4 has, y además una fracción de 10000 m2 fuera de planos que costean el río Mendoza, gozan de derecho de uso, goce y explotación en razón de ser propiedad lindera con el río excelentes para parquizar, monte natural (sauces, cortaderas, etc. ) cultivo de vid, dique( aprovechando las vertientes naturales de excelente agua existente en la propiedad),etc.
CASA:  Rodeada de grandes galerías se destaca por las maderas utilizadas en su construcción, marcos de cajón de pinotea pisos y techos entablonados, parantes de pinotea.
Consta de living, comedor, sala de juegos, bar, sala de estar, estar de diario, cocina de campo, dormitorios, baño y escritorio. Las dependencias de servicio se encuentran fuera del inmueble. Rodeada de parque con árboles añosos, piscina con equipo, con vista al río, sierras y cordillera. Potencial para fiestas, alojamiento, Spa, base de bodegas, museo de vinos, club house, condominio,  etc. ZONA DE SERVICIOS: Casa para caseros completa, galpones, taller, cisterna, tradicional horno de barro.
ZONA DE CRIA: La zona de cabaña tiene pesebreras y padrilleras de invierno para caballos, pastoreo, corrales de verano y demás complemento de la actividad.
