tilizadas en su construcción, marcos de cajón de pinotea pisos y techos entablonados, parantes de pinotea. Consta de living, comedor, antigua sala de juegos bar (hoy utilizados como dormitorio y vestidor), sala de estar, estar de diario, cocina de campo, 3 dormitorios, baño y escritorio. Las dependencias de servicio se encuentran fuera del inmueble. Rodeada de parque con árboles añosos, piscina con equipo, con vista al río, sierras y cordillera. Potencial para fiestas, alojamiento, Spa, base de bodegas, museo de vinos, club house, condominio, etc. ZONA DE SERVICIOS: Casa para caseros completa, galpones, taller, cisterna, tradicional horno de barro. ZONA DE CRIA de Caballos: La zona de cabaña tiene pesebreras y padrilleras de invierno para caballos,  corrales de verano y demás complemento de la actividad. Servicios: Agua propia de manantial (vertiente y aljibe automatizado) Derecho de riego, cisterna con bombas, Luz de red, Gas a granel (zeppelín), gas de red proyectado. Cultivos: 60  Olivos adultos. DESCRIPCIÓN DE LA ZONA: La zona del bajo lunlunta se encuentra dentro de la primera zona de producción vitivinícola famosa en Argentina y el mundo por su microclima donde radican añosos cultivos de vid , Se destaca también por ser una zona de alto potencial turístico, con lugares históricos como el seminario de lunlunta y bellezas naturales. Polo de tradición gaucha hallándose en la zona criadores de caballos criollos puros. Perimetro cerrado y sistema de Alarma.',255,17,1,-1,-1,-1,-1,-1,'2007-04-13','','620000','                                      ',2,200000,0,'2003-06-24','0',24,'0','0',-1,-1,'0','0','0','',1,'',6,1,1,1,1,0,'1','','','8');insert into ser_x_prp_ihost (prp_id,ser_id,valor,usr_id) values('3190',2,'',17);insert into ser_x_prp_ihost (prp_id,ser_id,valor,usr_id) values('3190',3,'',17);insert into ser_x_prp_ihost (prp_id,ser_id,valor,usr_id) values('3190',4,'Garage',17);insert into ser_x_prp_ihost (prp_id,ser_id,valor,usr_id) values('3190',5,'',17);insert i